import React from "react";

const Navbar = (props) => {
  return (
    <div>
      Navbar
      <a href="#" onClick={props.page="register"}>Register</a>
      <a>Login</a>
      <a>Dashboard</a>
      <a>Parent Portal</a>
    </div>
  )
}

export default Navbar
